import React from 'react';
import {Route} from "react-router-dom";
import Home from './pages/Home';
import './App.css';
import { Form, Icon, Input, Button, Checkbox } from 'antd';
import 'antd/dist/antd.css';
 // import Home from "./pages/Home";

class App extends React.Component{
  constructor(props){
    super(props);
    this.state={
      menu:[
        {
          name:"home",
          path:'/home',
          text:'首页'
        }
      ]
    }
    this.login = this.login.bind(this);
  }
  login(e){
    console.log(e)
  }
  render(){
    // const { getFieldDecorator } = this.props.form;
    return (
      <div className="app-box">
        <h1 className="app-h1">后台管理系统</h1>
        <div className="app-form">
          <input className="app-username" type="text" placeholder="用户名"></input>
          <input className="app-password" type="password" placeholder="密码"></input><br/>
          <input type="checkbox" style={{width:15,height:15}}></input><span>记住密码</span><br></br>
          <button>登录</button>
        </div>


        <Route path="/home" Component={Home}/>
      </div>
    )
  }
}
   App = Form.create({ name: 'normal_login' })(App);

export default App;
